import React, { Component } from "react";
import "./index.css";
import ClipView from "./clip-cell";
export default class ClipsBar extends Component {
  constructor(props) {
    super(props);
    this.state = {
      data: [1, 2, 3, 4],
    };
  }
  render() {
    const { data } = this.state;
    return (
      <div style={{backgroundColor: '#c51f5d'}}>
          <section style={{marginTop:'3vh'}}>
              <label style={{fontSize: '70px', color:'#c51f5d'}}>Clips</label>
          </section>
        <div className="video-container">
          {data.map((clip) => {
            return <ClipView />;
          })}
        </div>
      </div>
    );
  }
}
